import {Routes, Route,Redirect} from 'react-router-dom';
const ProductedRoute = ({component, ...rest}) =>{
    let RenderComponent = component;
    return(
        <Routes>  
        <Route>
            {/* {...rest} */}
            render={
                props => {
                   return( true ? (<RenderComponent {...props} />):(
                        <Redirect
                        to={{
                            pathname:'login'
                        }}
                        />)
                    )

                }
            }
        </Route>
        </Routes>  
    )
}

export default ProductedRoute
